import DataSlidebar from "../DataSlidebar.json";

export default function CardCours() {
  return (
    <span className="mt-5">
      {DataSlidebar.PremierAc.map((it) => (
        <sapn className="rien">
          <span className="card bg-primary text-white mb-5">
            <span className="card-body">{it.title}</span>
            <span className="card-footer d-flex align-items-center justify-content-between">
              <a className="small text-white stretched-link" href="#">
                voir d√©tail
              </a>
              <span className="small text-white">
                <i className="fas fa-angle-right"></i>
              </span>
            </span>
          </span>
        </sapn>
      ))}
    </span>
  );
}
